import React from 'react';
import estilo from './styles';
import { View, Text, Image, Button, TouchableOpacity} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import logoImg from '../../assets/icon.png';
import { TextInput, ScrollView } from 'react-native-gesture-handler';

export default function Index(){

    const nav = useNavigation();

    function backToLogin(){
        nav.navigate('login')
    }

    return(
        <View style={estilo.container}>
            <View style={estilo.header}>
                <Image style={estilo.img_logo} source={logoImg}/>
                <Text style={estilo.p_header}>TrampaÃª</Text>
            </View>
            <ScrollView>
                <View style={estilo.container_login}>
                    <Text style={estilo.title_login}>Cadastro</Text>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>Nome</Text>
                        <TextInput 
                            keyboardType="default" 
                            style={estilo.input}
                            autoCapitalize="none"
                            allowFontScaling={false}
                        />
                    </View>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>Email</Text>
                        <TextInput 
                            keyboardType="visible-password" 
                            multiline={false}  
                            style={estilo.input}
                            secureTextEntry={true}
                            autoCapitalize="none"
                            allowFontScaling={false}
                        />
                    </View>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>Whatsapp</Text>
                        <TextInput 
                            keyboardType="phone-pad" 
                            multiline={false}  
                            style={estilo.input}

                            secureTextEntry={true}
                            autoCapitalize="none"
                            allowFontScaling={false}
                        />
                    </View>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>Cidade</Text>
                        <TextInput 
                            keyboardType="visible-password" 
                            multiline={false}  
                            style={estilo.input}
                            secureTextEntry={true}
                            // autoCapitalize="none"
                            allowFontScaling={false}
                        />
                    </View>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>UF</Text>
                        <TextInput 
                            keyboardType="visible-password" 
                            multiline={false}  
                            style={estilo.input}
                            secureTextEntry={true}
                            autoCapitalize="none"
                            allowFontScaling={false}
                            maxLength={2}
                        />
                    </View>
                    <View style={estilo.input_group}>
                        <Text style={estilo.label}>Senha</Text>
                        <TextInput 
                            keyboardType="visible-password" 
                            multiline={false}  
                            style={estilo.input}
                            secureTextEntry={true}
                            autoCapitalize="none"
                            allowFontScaling={false}
                        />
                    </View>
                    <TouchableOpacity style={estilo.button}>
                        <Text style={estilo.p_button}>Cadastrar</Text>
                    </TouchableOpacity>
                    <TouchableOpacity onPress={backToLogin} style={estilo.link_cadastro}>
                        <Text style={estilo.p_link}>Voltar para o Login</Text>
                    </TouchableOpacity>
                </View>
            </ScrollView>
        </View>
    );
}
